import React, { Component } from 'react';
import logo from '../logo.svg';
import '../App.css';

class App extends Component {
  state = {
    users: [],
    isLoading: true
  }

  componentDidMount() {
    setTimeout(() => {


    fetch('http://jsonplaceholder.typicode.com/users')
    .then(data => data.json())
    .then(users => {
      this.setState({
        users,
        isLoading:false
      })
    })
      },2000)
  }

  render() {
    const {isLoading} = this.state;
    return (
      <div className="App">
        <h1>Users</h1>
        {isLoading ? 'Loading...' : ''}
        {
          this.state.users.map(user => 
            <div>
            <p>
              <b>name: </b>{user.name} <br/> <b>username: </b> = {user.username}
              </p>
            </div>
          )
        }
      </div>
    );
  }
}

export default App;
